const DetailList = ({selected}) => {
  console.log(selected.flashcards);
  return (
    <div>
      <h2>{selected.name} 플래시카드</h2>
      <ul>
        {/* li요소를 이용하여 작성 */}
        {
          selected.flashcards.map((obj)=>{
            return <li key={obj.id}>{obj.question}</li>
          })
        }
      </ul>
    </div>
  );
};

export default DetailList;
